import React, { Component } from "react";
import GooglePlacesAutocomplete from "react-google-places-autocomplete";



class Person extends Component {
  render() {
    
    const renderFunc = ({ getInputProps, getSuggestionItemProps, suggestions }) => (
      <div className="autocomplete-root">
        <input style={{width:"500px"}} {...getInputProps()} />
        <div className="autocomplete-dropdown-container">
          {suggestions.map(suggestion => (
            <div {...getSuggestionItemProps(suggestion)}>
              <span>{suggestion.description}</span>
            </div>
          ))}
        </div>
      </div>
    );

    return (
      <div>
        <h4><span className="badge badge-info">Person #{this.props.value}</span></h4>



        <form>
          
          <GooglePlacesAutocomplete
            style={{width:"500px"}}
            apiKey={"AIzaSyAF6LzDWnCO0yQ3_xVfXMYicN6MqUFl4q0"}
            onSetAddress={this.props.onSetAddress}
            onSelect={({ description }) =>
              this.props.onSetAddress(description, this.props.value)
            }
            
          >{renderFunc}</GooglePlacesAutocomplete>
          <input style={{width:"500px"}}type="text" placeholder="email" onChange={(e) => this.props.onSetEmail(e.target.value,this.props.value)}></input>
        </form>
      </div>
    );
  }
}

export default Person;
